import style from "./NavBar.module.css";
import React, { useState } from "react";
import { Link } from "react-router-dom";

function NavBar() {
  /* const [isValid, setIsValid] = useState("");

  function toggleMenuOpen() {
    setIsValid();
  } */
function setToggleMenuOpen(){
  document.body.classList.toggle("open");    
}
       
  

  return (
    /*"navbar-overlay"*/
    /* `${style["navbar-overlay"]} ${style.open}` */
    
      <nav className="nav">
        <div
          className="navbar-overlay"
          onClick={setToggleMenuOpen}
        ></div>
        <Link to="/Glowna" onClick={setToggleMenuOpen}>
          <button type="button" className="navbar-burger">
            <span className="material-icons">menu</span>
          </button>
        </Link>
        <div className="plose2">
          <p className="ak">
            Biuro rachunkowe z pasją. Świadczymy usługi dla Ciebie.
          </p>
        </div>
        <h1 className="navbar-title">Biuro Rachunkowe BALANS</h1>
        <nav className="navbar-menu">
          <ul>
            <li>
              <Link to="/Glowna">
                <button type="button">
                  <span>Główna</span>
                </button>
              </Link>
            </li>
            <li>
              <Link to="/Oferta">
                <button type="button">
                  <span>Oferta</span>
                </button>
              </Link>
            </li>
            <li>
              <Link to="/Kontakt">
                <button type="button">
                  <span>Kontakt</span>
                </button>
              </Link>
            </li>
          </ul>
        </nav>
      </nav>
    
  );
}

export default NavBar;
